entry.value:
insert or replace into tags values (
        ${qg.hostid}, ${qg.tag.id}, '${qg.tag.name:replace("'",'"')}'
);

-- hosts tables
DROP TABLE if exists hosts;
CREATE TABLE hosts (
        id INT, qghostid, ip, dns, netbios, os, tracking, network INT,
        lastscan, lastvmscan, lastvmauth, lastpcscan
);
CREATE UNIQUE INDEX hosts_id on hosts (id);

-- tags assigned to hosts
CREATE TABLE tags (
        id, tagid, name
);
CREATE UNIQUE INDEX tag_id_tagid on tags (id, tagid);

-- vm detections for hosts
DROP TABLE if exists vm;
CREATE TABLE vm (
        id INT, qid INT, 
        status, type, severity INT, results,
        port INT, protocol, service,
        ssl, disabled, ignored,
        firstfound, lastfound, lastprocessed
);
CREATE UNIQUE INDEX vm_id_qid on vm (id, qid, port, protocol);

insert or replace into hosts values (
        ${qg.hostid}, '${qg.qghostid}', 
		'${qg.ip}', '${qg.dns}', '${qg.netbios}', 
		'${qg.os:replace("'",'""')}', '${qg.tracking}', '${qg.network}',
        '${qg.lastscan}', '${qg.lastvmscan}', '${qg.lastvmauth}', '${qg.lastpcscan}'
);
